import React from "react";
import CartWidget from "./CartWidget";
const NavBar= () =>{
    return(
        <nav>
            <h1>3DLocuras</h1>
            <img src="./imagen/header.png"></img>
            <ul>
                <li>Inicio</li>
                <li>Contactos</li>
                <li>Catalogo</li>
            </ul>
        <CartWidget/>
        </nav>
    )
}
export default NavBar;
